using Marathon.Core.ViewModel.Base;

namespace Marathon.Core.ViewModel.ManageCharity.Design
{
    /// <summary>
    /// The design-time data for a <see cref="ManageCharityViewModel"/>
    /// </summary>
    public class ManageCharityDesignModel : ManageCharityViewModel
    {
        #region Singleton

        /// <summary>
        /// A single instance of the design model
        /// </summary>
        public static ManageCharityDesignModel Instance => new ManageCharityDesignModel();

        #endregion

        #region Constructor

        /// <summary>
        /// Default Constructor
        /// </summary>
        public ManageCharityDesignModel()
        {
            Name.Value = "Charity name";
            Description.Value = "More\n" +
                          "info\n" +
                          "about\n" +
                          "charity";
            Logo.Value = DesignModelHelpers.StringToByteArray("");
            LogoFileName.Value = "conquer-cancer-brazil.png";
        }

        #endregion
    }
}
